import { useState } from "react";
function App() {
  const [res, setRes] = useState(2);
  const changeRes = () => {
    setRes(res * 2);
  };
  return (
    <>
      <h4>res is now : {res} </h4>
      <button onClick={changeRes}>click</button>
    </>
  );
}

export default App;
